"use strict";
const imageElement = document.getElementById("frame");
// Load the Base64 file generated by Android app
fetch("sample_frame_base64.txt")
    .then(res => res.text())
    .then(base64 => {
    base64 = base64.trim();
    imageElement.src = "data:image/png;base64," + base64;
})
    .catch(err => {
    console.error("Error loading frame:", err);
    imageElement.alt = "Failed to load image";
});
